CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_changepassword`(_username varchar(50),_old varchar(25), _new varchar(25), _conf varchar(25))
BEGIN
	set @myold = (select password from user where username=_username);
	if @myold <> _old then
		select -1;
	elseif _new=_conf then
		update user set password=_new where username=_username;
		select 1;
	end if;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_createuser`(IN `p_username` VARCHAR(50), IN `p_password` VARCHAR(50), IN `p_namapengguna` VARCHAR(50))
    NO SQL
BEGIN 

