CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_isgenbi`(IN `p_nrp` VARCHAR(20))
    NO SQL
BEGIN 

IF ((SELECT COUNT(nrp) FROM master_nrp WHERE nrp = p_nrp) > 0)
THEN
	IF ((SELECT COUNT(nrp) FROM master_nrp WHERE nrp = p_nrp AND status = 'BELUM') > 0)
    THEN
    	SELECT nrp AS message, 1 as flag FROM master_nrp WHERE nrp = p_nrp;
        UPDATE master_nrp set status = 'SUDAH' WHERE nrp = p_nrp;
    ELSE
    	SELECT 'data anda sudah terdaftar.' as message, 2 as flag;
    END IF;
ELSE 
	select 'data nrp anda tidak terdaftar pada sistem.' as message, 3 as flag;
END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_login`(IN `p_username` VARCHAR(50), IN `p_password` VARCHAR(50))
    NO SQL
begin 

if (select 1 from pengguna where username = p_username and`password`= p_password)
then
	update pengguna set last_login = now() where username = p_username and password = p_password;
    select nama_pengguna as message, 1 as flag from pengguna where username = p_username and password = p_password;
else 
	select 'username atau password yang anda masukkan salah' as message, 0 as flag;
end if;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_tambahevent`(IN `_judul` VARCHAR(100), IN `_deksripsi` VARCHAR(500), IN `_lokasi` VARCHAR(255), IN `_tanggal` VARCHAR(20), IN `_waktu` VARCHAR(20) ,IN `_lat` FLOAT, IN `_lng` FLOAT, IN `_area1` VARCHAR(100), IN `_area2` VARCHAR(100), IN `_fk_kategori` INT(2), IN `_username` VARCHAR(50), IN `_promote` TINYINT(1))
BEGIN
	#insert event
	INSERT INTO event(judul,deskripsi,tanggal,waktu,lokasi,lat,lng,area1,area2,timestamp,fk_kategori) 
	VALUES (_judul,_deksripsi,_tanggal,_waktu,_lokasi,_lat,_lng,_area1,_area2,now(),_fk_kategori);
	SET @id = (SELECT LAST_INSERT_ID());	
	
	#insert relasi
	insert into relasi_event_user(fk_event,fk_user,status)
	values(@id,_username,0);
	
	#promoted
	IF(_promote = 1) THEN 
		INSERT INTO promoted(fk_event) VALUES(@id);
	end if;
	
	select 1 as callback;
END$$

DELIMITER ;

